INSERT INTO `sub_subtopics` VALUES (16,'part1','<p><img src=\"https://imgs.search.brave.com/MtGerpQv6bmfDDuGmWJj3HfPXi85BcN2Dnh0avDftno/rs:fit:500:0:0:0/g:ce/aHR0cHM6Ly90My5m/dGNkbi5uZXQvanBn/LzAyLzI5LzUzLzMw/LzM2MF9GXzIyOTUz/MzA4MF95YzkzdndQ/VFZCcElYNDIzREZS/bkJDc0VZYWlISjUx/Ny5qcGc\" alt=\"lotus flower\"></p>\r\n<p>dszdfgvhbjkjgfdghjygtfrdedfgbvvjythredfgh jhgfjhgx</p>',34,0,NULL),(17,'asdfghj','<p>sdfghjklqqqqqqqqqqqqqqqqq</p>\r\n<p>kjhugfdxcv bnjhgfdxcvbhjuytfcvbjhgfcvbnjh&nbsp;</p>\r\n<h1>Python&nbsp;<span class=\"color_h1\">Tutorial</span></h1>\r\n<div class=\"w3-clear nextprev\"><a class=\"w3-left w3-btn\" href=\"https://www.w3schools.com/default.asp\">❮ Home</a><a class=\"w3-right w3-btn\" href=\"https://www.w3schools.com/python/python_intro.asp\">Next ❯</a></div>\r\n<div class=\"w3-panel ws-info intro\">\r\n<h2>Learn Python</h2>\r\n<p>Python is a popular programming language.</p>\r\n<p>Python can be used on a server to create web applications.</p>\r\n<a class=\"w3-btn w3-margin-bottom\" href=\"https://www.w3schools.com/python/python_intro.asp\">Start learning Python now &raquo;</a></div>\r\n<hr>\r\n<h2>Learning by Examples</h2>\r\n<p>With our \"Try it Yourself\" editor, you can edit Python code and view the result.</p>\r\n<div class=\"w3-example\">\r\n<h3>Example<a class=\"ws-black ws-hover-black spaces-tryit ga-featured\" title=\"W3Schools Spaces\" href=\"https://www.w3schools.com/python/python_server.asp\" target=\"_blank\" rel=\"noopener\">Get your own Python Server</a></h3>\r\n<div class=\"w3-code notranslate pythonHigh\"><span class=\"pythoncolor\"><span class=\"pythonkeywordcolor\">print</span>(<span class=\"pythonstringcolor\">\"Hello, World!\"</span>)</span></div>\r\n<a class=\"w3-btn w3-margin-bottom\" href=\"https://www.w3schools.com/python/trypython.asp?filename=demo_default\" target=\"_blank\" rel=\"noopener\">Try it Yourself &raquo;</a></div>\r\n<p><strong>Click on the \"Try it Yourself\" button to see how it works.</strong></p>\r\n<hr>\r\n<h2>Python File Handling</h2>\r\n<p>In our File Handling section you will learn how to open, read, write, and delete files.</p>\r\n<p><a href=\"https://www.w3schools.com/python/python_file_handling.asp\">Python File Handling</a></p>\r\n<hr>\r\n<h2>Python Database Handling</h2>\r\n<p>In our database section you will learn how to access and work with MySQL and MongoDB databases:</p>\r\n<p><a href=\"https://www.w3schools.com/python/python_mysql_getstarted.asp\">Python MySQL Tutorial</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/python_mongodb_getstarted.asp\">Python MongoDB Tutorial</a></p>\r\n<hr>\r\n<h2>Python Exercises</h2>\r\n<p>Many chapters in this tutorial end with an exercise where you can check your level of knowledge.</p>\r\n<div id=\"exercisecontainer\">\r\n<h2>Exercise<span class=\"questionmark w3-tooltip\">?</span></h2>\r\n<p>What is a correct way to declare a Python variable?</p>\r\n<br><form action=\"https://www.w3schools.com/python/exercise.asp?x=xrcise_variables1\" method=\"post\" target=\"_blank\">\r\n<div class=\"quizoption\"><input id=\"quizoption0\" name=\"quizoption\" type=\"radio\" value=\"0\"><label for=\"quizoption0\"><code>var x = 5</code></label></div>\r\n<div class=\"quizoption\"><input id=\"quizoption1\" name=\"quizoption\" type=\"radio\" value=\"1\"><label for=\"quizoption1\"><code>#x = 5</code></label></div>\r\n<div class=\"quizoption\"><input id=\"quizoption2\" name=\"quizoption\" type=\"radio\" value=\"2\"><label for=\"quizoption2\"><code>$x = 5</code></label></div>\r\n<div class=\"quizoption\"><input id=\"quizoption3\" name=\"quizoption\" type=\"radio\" value=\"3\"><label for=\"quizoption3\"><code>x = 5</code></label></div>\r\n<br><button class=\"ws-btn\" type=\"submit\">Submit Answer &raquo;</button></form></div>\r\n<p><a class=\"w3-btn w3-margin-bottom ws-green\" href=\"https://www.w3schools.com/python/python_exercises.asp\">See all Python Exercises</a></p>\r\n<hr>\r\n<div id=\"midcontentadcontainer\"></div>\r\n<hr>\r\n<h2>Python Examples</h2>\r\n<p>Learn by examples! This tutorial supplements all explanations with clarifying examples.</p>\r\n<p><a class=\"w3-button w3-light-grey w3-round\" href=\"https://www.w3schools.com/python/python_examples.asp\">See All Python Examples</a></p>\r\n<hr>\r\n<h2>Python Quiz</h2>\r\n<p>Test your Python skills with a quiz.</p>\r\n<p><a class=\"w3-button w3-blue w3-round\" href=\"https://www.w3schools.com/python/python_quiz.asp\">Python Quiz</a></p>\r\n<hr>\r\n<h2>Track Your Progress</h2>\r\n<div class=\"containerlog\">\r\n<div class=\"left-panel\">\r\n<h6>Create a free W3Schools account and get access to more features and learning materials:</h6>\r\n<br>\r\n<ul class=\"checklist\">\r\n<li><img src=\"https://www.w3schools.com/spaces/files/check3.db67d31e.svg\" alt=\"Checkmark\">View your completed tutorials, exercises, and quizzes</li>\r\n<li><img src=\"https://www.w3schools.com/spaces/files/check3.db67d31e.svg\" alt=\"Checkmark\">Keep an eye on your progress and daily streaks</li>\r\n<li><img src=\"https://www.w3schools.com/spaces/files/check3.db67d31e.svg\" alt=\"Checkmark\">Set goals and create learning paths</li>\r\n<li><img src=\"https://www.w3schools.com/spaces/files/check3.db67d31e.svg\" alt=\"Checkmark\">Create your own personal website</li>\r\n</ul>\r\n<p><a id=\"myLearningFromDefault\" class=\"ws-btn tut-button\" title=\"Sign up to try My Learning\" href=\"https://profile.w3schools.com/sign-up?redirect_url=https%3A%2F%2Fwww.w3schools.com%2Fpython%2Fdefault.asp\" target=\"_blank\" rel=\"noopener\">Sign Up for Free</a></p>\r\n</div>\r\n<div class=\"right-panel\" title=\"Track your progress with a W3Schools account\">&nbsp;</div>\r\n</div>\r\n<p><strong>Note:</strong>&nbsp;This is an optional feature. You can study at W3Schools without creating an account.</p>\r\n<hr>\r\n<h2>Python Reference</h2>\r\n<p>You will also find complete function and method references:</p>\r\n<p><a href=\"https://www.w3schools.com/python/python_reference.asp\">Reference Overview</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/python_ref_functions.asp\">Built-in Functions</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/python_ref_string.asp\">String Methods</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/python_ref_list.asp\">List/Array Methods</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/python_ref_dictionary.asp\">Dictionary Methods</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/python_ref_tuple.asp\">Tuple Methods</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/python_ref_set.asp\">Set Methods</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/python_ref_file.asp\">File Methods</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/python_ref_keywords.asp\">Python Keywords</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/python_ref_exceptions.asp\">Python Exceptions</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/python_ref_glossary.asp\">Python Glossary</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/module_random.asp\">Random Module</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/module_requests.asp\">Requests Module</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/module_math.asp\">Math Module</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/module_cmath.asp\">CMath Module</a></p>\r\n<hr>\r\n<h2>Download Python</h2>\r\n<p>Download Python from the official Python web site:&nbsp;<a href=\"https://python.org/\" target=\"_blank\" rel=\"noopener\">https://python.org</a></p>',34,0,NULL),(18,'kiuytrdfcvbnjuyt','<p>jhdxcvbgyjfgcvbnkmjiuytrdf</p>',34,0,NULL),(19,'kjhgfcjhgvbhghbhhgvgvh','<p>jhnbvjhvjmhnvb jhmbn&nbsp;</p>\r\n<p>hjgtfrdfvgffcvhhjmyhn <img title=\"bottle.jpg\" src=\"../uploads/bottle_2.jpg\" alt=\"\" width=\"183\" height=\"183\"> jhgtfrdfcvghuytfrcvghjygtf</p>',34,0,1),(20,'jhgfdxcvbnj','<p>njhftdrfcvbjhuiyfgcvmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmmm</p>',36,0,1),(23,'jhgfcv bnhjtgfcvbhgfd','<h1 styl