INSERT INTO `subtopics` VALUES (34,'intro','<h1 style=\"text-align: center;\">sdfghiuytsdh</h1>\r\n<p>&nbsp;</p>\r\n<h2>Python Database Handling</h2>\r\n<p>In our database section you will learn how to access and work with MySQL and MongoDB databases: <img src=\"https://imgs.search.brave.com/MtGerpQv6bmfDDuGmWJj3HfPXi85BcN2Dnh0avDftno/rs:fit:500:0:0:0/g:ce/aHR0cHM6Ly90My5m/dGNkbi5uZXQvanBn/LzAyLzI5LzUzLzMw/LzM2MF9GXzIyOTUz/MzA4MF95YzkzdndQ/VFZCcElYNDIzREZS/bkJDc0VZYWlISjUx/Ny5qcGc\" alt=\"lotus flower\" width=\"196\" height=\"79\"></p>\r\n<p><a href=\"https://www.w3schools.com/python/python_mysql_getstarted.asp\">Python MySQL Tutorial</a></p>\r\n<p><a href=\"https://www.w3schools.com/python/python_mongodb_getstarted.asp\">Python MongoDB Tutorial&nbsp;&nbsp;&nbsp;&nbsp;</a></p>',NULL,43,NULL,NULL,1),(36,'Python','<div class=\"contentcontainer\">\r\n<div class=\"belowtopnavcontainer\">\r\n<div id=\"belowtopnav\" class=\"w3-main w3-light-grey\">\r\n<div class=\"w3-row w3-white\">\r\n<div id=\"main\" class=\"w3-col l10 m12\">\r\n<h1 style=\"text-align: center;\">Python <span class=\"color_h1\">String Methods</span></h1>\r\n<div class=\"w3-clear nextprev\"><a class=\"w3-left w3-btn\" href=\"https://www.w3schools.com/python/python_ref_functions.asp\">❮ Previous</a><a class=\"w3-right w3-btn\" href=\"https://www.w3schools.com/python/python_ref_list.asp\">Next ❯</a></div>\r\n<hr>\r\n<p>Python has a set of built-in methods that you can use on strings.</p>\r\n<div class=\"w3-panel ws-note\">\r\n<p><strong>Note:</strong>&nbsp;All string methods returns new values. They do not change the original string.</p>\r\n</div>\r\n<table class=\"ws-table-all notranslate\">\r\n<tbody>\r\n<tr>\r\n<th>Method</th>\r\n<th>Description</th>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_capitalize.asp\">capitalize()</a></td>\r\n<td>Converts the first character to upper case</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_casefold.asp\">casefold()</a></td>\r\n<td>Converts string into lower case</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_center.asp\">center()</a></td>\r\n<td>Returns a centered string</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_count.asp\">count()</a></td>\r\n<td>Returns the number of times a specified value occurs in a string</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_encode.asp\">encode()</a></td>\r\n<td>Returns an encoded version of the string</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_endswith.asp\">endswith()</a></td>\r\n<td>Returns true if the string ends with the specified value</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_expandtabs.asp\">expandtabs()</a></td>\r\n<td>Sets the tab size of the string</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_find.asp\">find()</a></td>\r\n<td>Searches the string for a specified value and returns the position of where it was found</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_format.asp\">format()</a></td>\r\n<td>Formats specified values in a string</td>\r\n</tr>\r\n<tr>\r\n<td>format_map()</td>\r\n<td>Formats specified values in a string</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_index.asp\">index()</a></td>\r\n<td>Searches the string for a specified value and returns the position of where it was found</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_isalnum.asp\">isalnum()</a></td>\r\n<td>Returns True if all characters in the string are alphanumeric</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_isalpha.asp\">isalpha()</a></td>\r\n<td>Returns True if all characters in the string are in the alphabet</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_isascii.asp\">isascii()</a></td>\r\n<td>Returns True if all characters in the string are ascii characters</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_isdecimal.asp\">isdecimal()</a></td>\r\n<td>Returns True if all characters in the string are decimals</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_isdigit.asp\">isdigit()</a></td>\r\n<td>Returns True if all characters in the string are digits</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_isidentifier.asp\">isidentifier()</a></td>\r\n<td>Returns True if the string is an identifier</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_islower.asp\">islower()</a></td>\r\n<td>Returns True if all characters in the string are lower case</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_isnumeric.asp\">isnumeric()</a></td>\r\n<td>Returns True if all characters in the string are numeric</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_isprintable.asp\">isprintable()</a></td>\r\n<td>Returns True if all characters in the string are printable</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_isspace.asp\">isspace()</a></td>\r\n<td>Returns True if all characters in the string are whitespaces</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_istitle.asp\">istitle()</a></td>\r\n<td>Returns True if the string follows the rules of a title</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_isupper.asp\">isupper()</a></td>\r\n<td>Returns True if all characters in the string are upper case</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_join.asp\">join()</a></td>\r\n<td>Converts the elements of an iterable into a string</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_ljust.asp\">ljust()</a></td>\r\n<td>Returns a left justified version of the string</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_lower.asp\">lower()</a></td>\r\n<td>Converts a string into lower case</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_lstrip.asp\">lstrip()</a></td>\r\n<td>Returns a left trim version of the string</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_maketrans.asp\">maketrans()</a></td>\r\n<td>Returns a translation table to be used in translations</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_partition.asp\">partition()</a></td>\r\n<td>Returns a tuple where the string is parted into three parts</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_replace.asp\">replace()</a></td>\r\n<td>Returns a string where a specified value is replaced with a specified value</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_rfind.asp\">rfind()</a></td>\r\n<td>Searches the string for a specified value and returns the last position of where it was found</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_rindex.asp\">rindex()</a></td>\r\n<td>Searches the string for a specified value and returns the last position of where it was found</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_rjust.asp\">rjust()</a></td>\r\n<td>Returns a right justified version of the string</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_rpartition.asp\">rpartition()</a></td>\r\n<td>Returns a tuple where the string is parted into three parts</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_rsplit.asp\">rsplit()</a></td>\r\n<td>Splits the string at the specified separator, and returns a list</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_rstrip.asp\">rstrip()</a></td>\r\n<td>Returns a right trim version of the string</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_split.asp\">split()</a></td>\r\n<td>Splits the string at the specified separator, and returns a list</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_splitlines.asp\">splitlines()</a></td>\r\n<td>Splits the string at line breaks and returns a list</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_startswith.asp\">startswith()</a></td>\r\n<td>Returns true if the string starts with the specified value</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_strip.asp\">strip()</a></td>\r\n<td>Returns a trimmed version of the string</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_swapcase.asp\">swapcase()</a></td>\r\n<td>Swaps cases, lower case becomes upper case and vice versa</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_title.asp\">title()</a></td>\r\n<td>Converts the first character of each word to upper case</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_translate.asp\">translate()</a></td>\r\n<td>Returns a translated string</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_upper.asp\">upper()</a></td>\r\n<td>Converts a string into upper case</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_string_zfill.asp\">zfill()</a></td>\r\n<td>Fills the string with a specified number of 0 values at the beginning</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"w3-panel ws-note\">\r\n<p><strong>Note:</strong>&nbsp;All string methods returns new values. They do not change the original string.</p>\r\n</div>\r\n<hr>\r\n<p>Learn more about strings in our&nbsp;<a href=\"https://www.w3schools.com/python/python_strings.asp\">Python Strings Tutorial</a>.</p>\r\n<hr><br>\r\n<div class=\"w3-clear nextprev\"><a class=\"w3-left w3-btn\" href=\"https://www.w3schools.com/python/python_ref_functions.asp\">❮ Previous</a><a class=\"w3-right w3-btn\" href=\"https://www.w3schools.com/python/python_ref_list.asp\">Next ❯</a></div>\r\n<div id=\"user-profile-bottom-wrapper\" class=\"user-profile-bottom-wrapper\">\r\n<div class=\"w3s-pathfinder -teaser user-anonymous\">\r\n<div class=\"-background-image -variant-t2\">&nbsp;</div>\r\n<div class=\"-inner-wrapper\">\r\n<div class=\"-main-section\">\r\n<div class=\"-inner-wrapper\">\r\n<div class=\"-headline\">Track your progress - it\'s free!</div>\r\n<div class=\"-body\">\r\n<div class=\"-progress-bar\">\r\n<div class=\"-slider\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"-right-side-section\">\r\n<div class=\"-user-session-btns\"><a class=\"-login-btn w3-btn bar-item-hover w3-right ws-light-green ga-bottom ga-bottom-login\" title=\"Login to your account\" href=\"https://profile.w3schools.com/log-in?redirect_url=https%3A%2F%2Fpathfinder.w3schools.com&amp;origin=https%3A%2F%2Fwww.w3schools.com%2Fpython%2Fpython_ref_string.asp\" target=\"_top\" aria-label=\"Login to your account\">Log in</a><a class=\"-signup-btn w3-button w3-right ws-green ws-hover-green ga-bottom ga-bottom-signup\" title=\"Sign Up to Improve Your Learning Experience\" href=\"https://profile.w3schools.com/sign-up?redirect_url=https%3A%2F%2Fpathfinder.w3schools.com&amp;origin=https%3A%2F%2Fwww.w3schools.com%2Fpython%2Fpython_ref_string.asp\" target=\"_top\" aria-label=\"Sign Up to Improve Your Learning Experience\">Sign Up</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\"right\" class=\"w3-col l2 m12\">\r\n<div class=\"sidesection\">\r\n<div id=\"skyscraper\"></div>\r\n</div>\r\n<br>\r\n<div class=\"sidesection\">\r\n<h4><a href=\"https://www.w3schools.com/colors/colors_picker.asp\">COLOR PICKER</a></h4>\r\n<img title=\"sofa.jpeg\" src=\"../uploads/sofa_2.jpeg\" alt=\"\" width=\"225\" height=\"225\"> kuytfrvgbnjkuytfgvhbjuytfcvbhjuytfcvbhjuytfgcvghytf <img src=\"data:image/jpeg;base64,\" alt=\"Beautiful Flowers Photos, Download The ...\"></div>\r\n<div class=\"sidesection\">\r\n<div class=\"sharethis\">&nbsp;&nbsp;&nbsp;&nbsp;</div>\r\n</div>\r\n<div id=\"vidpos\" class=\"sidesection\"></div>\r\n<div id=\"stickypos\" class=\"sidesection\">\r\n<div id=\"stickyadcontainer\">\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\"footer\" class=\"footer w3-container w3-white\">\r\n<div id=\"bottomads\">\r\n<div>&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div id=\"wrappercontainer\">\r\n<div id=\"footerwrapper\">\r\n<div id=\"spacemyfooter\">\r\n<div>\r\n<div class=\"footerlinks_1\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>',NULL,43,NULL,NULL,1),(37,'intro','<div class=\"contentcontainer\">\r\n<div class=\"belowtopnavcontainer\">\r\n<div id=\"belowtopnav\" class=\"w3-main w3-light-grey\">\r\n<div class=\"w3-row w3-white\">\r\n<div id=\"main\" class=\"w3-col l10 m12\">\r\n<h1 style=\"text-align: center;\">Python&nbsp;<span class=\"color_h1\">List/Array Methods</span></h1>\r\n<div class=\"w3-clear nextprev\"><a class=\"w3-left w3-btn\" href=\"https://www.w3schools.com/python/python_ref_string.asp\">❮ Previous</a><a class=\"w3-right w3-btn\" href=\"https://www.w3schools.com/python/python_ref_dictionary.asp\">Next ❯</a></div>\r\n<hr>\r\n<p>Python has a set of built-in methods that you can use on lists/arrays.</p>\r\n<table class=\"ws-table-all notranslate\">\r\n<tbody>\r\n<tr>\r\n<th>Method</th>\r\n<th>Description</th>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_list_append.asp\">append()</a></td>\r\n<td>Adds an element at the end of the list</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_list_clear.asp\">clear()</a></td>\r\n<td>Removes all the elements from the list</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_list_copy.asp\">copy()</a></td>\r\n<td>Returns a copy of the list</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_list_count.asp\">count()</a></td>\r\n<td>Returns the number of elements with the specified value</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_list_extend.asp\">extend()</a></td>\r\n<td>Add the elements of a list (or any iterable), to the end of the current list</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_list_index.asp\">index()</a></td>\r\n<td>Returns the index of the first element with the specified value</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_list_insert.asp\">insert()</a></td>\r\n<td>Adds an element at the specified position</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_list_pop.asp\">pop()</a></td>\r\n<td>Removes the element at the specified position</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_list_remove.asp\">remove()</a></td>\r\n<td>Removes the first item with the specified value</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_list_reverse.asp\">reverse()</a></td>\r\n<td>Reverses the order of the list</td>\r\n</tr>\r\n<tr>\r\n<td><a href=\"https://www.w3schools.com/python/ref_list_sort.asp\">sort()</a></td>\r\n<td>Sorts the list</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"w3-panel ws-note\">\r\n<p><strong>Note:</strong>&nbsp;Python does not have built-in support for Arrays, but Python Lists can be used instead.</p>\r\n</div>\r\n<hr>\r\n<p>Learn more about lists in our&nbsp;<a href=\"https://www.w3schools.com/python/python_lists.asp\">Python Lists Tutorial</a>.</p>\r\n<p>Learn more about arrays in our&nbsp;<a href=\"https://www.w3schools.com/python/python_arrays.asp\">Python Arrays Tutorial</a>.</p>\r\n<hr>\r\n<div class=\"w3-clear nextprev\"><a class=\"w3-left w3-btn\" href=\"h